import React from "react";

class EmployeeList extends React.Component {
  state = {
    employees: [
      {
        id: 1,
        picture: "https://randomuser.me/api/portraits/men/75.jpg",
        name: "Thomas Goodwin",
        gender: "male",
        city: "salt Lake City",
        postcode: "84103",
        email: "tgoodwin@gmail.com",
        registered: "2002-05-21T10:59:49.966Z",
      },
      {
        id: 1,
        picture: "https://randomuser.me/api/portraits/men/75.jpg",
        name: "Thomas Goodwin",
        gender: "male",
        city: "salt Lake City",
        postcode: "84103",
        email: "tgoodwin@gmail.com",
        registered: "2002-05-21T10:59:49.966Z",
      },
    ],
  };

  componentDidMount() {
    console.log("mounted");
    fetch("https://randomuser.me/api/?results=25&nat=us")
      .then((response) => response.json())
      .then((data) =>
        this.setState(() => {
          console.log(data);
          return { data };
        })
      );
  }
  render() {
    return (
      <div>
        <ul>
          {this.state.employees.map((employees) => (
            <li>{employees.name}</li>
          ))}
        </ul>
      </div>
    );
  }
}
export default EmployeeList;
